import React from "react";
import "./Login.css";

export default function Login() {
  return (
    <div className="login">
      <div className="container">
        <p className="sign-in">Sign in</p>
        <p className="text">Email</p>
        <input type="text" className="input" />
        <p className="text">PassWord</p>
        <input type="text" className="input" />
      </div>
    </div>
  );
}
